INSERT INTO `t_help_center` (`t_id`, `t_title`, `t_content`, `t_sort`, `t_create_time`) VALUES
	(1, '关于“巧遇”', '【巧遇】同城一对一视频交友王国，附近美女等你来征服。', 1, '2019-04-28 11:27:20'),
	(2, '巧遇“文明公约”', '为保障巧遇直播平台的基本秩序，创造良好的直播坏境，同时，也为了给用户提供一个健康和谐的才艺展示与交友平台，特制定本文明公约。 \n本公约条款适用于巧遇直播的所有主播及用户，适用于所有直播及一对一交友形式。 \n1、禁止发表或播放任何包含危害国家安全、泄露国家秘密、颠覆国家政权、破坏国家统一的相关内容；\n2、禁止以任何形式播放包含破坏民族团结、损害国家荣誉和利益、煽动民族仇恨、 民族歧视、破坏民族团结的相关内容；\n3、禁止以任何形式播放包含破坏国家宗教 政策、宣扬邪教和封建迷信的相关内容；\n4、禁止以任何形式播放包含淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的相关内容\n5、禁止以任何形式播放国家相关法律、行政法规明令禁止的内容或其他另人反感的包括但不限于资讯、资料、文字、软件、音乐、照片、图形、信息或其他资料；\n6、禁止涉及政治、军事、经济、 社会、休育、访谈评沦等类视听节目及直播间；\n7、禁止视频聊天、速配、直播过程中长时间不露脸、衣着暴露、淫秽色情表演和诱惑动作或者言论；\n8、禁止传播、展示、转让毒品、枪支弹药、管制刀具等违禁品信息；\n9、禁止播放虚假广告、赚取广告；\n10、禁止未成年人直播；\n11、禁止播放版权所有人禁止播放的视频作品。 \n\n若巧遇有现任何有达反《巧遇平台直播公约》的行为，巧遇将会在第一时问视情况轻重，相应给予警告、停播或封停帐号处理，帐号一旦被封禁处理，账户所关联的身份证、手机号码、银行卡等信息都无法继续使用巧遇服务。对于触犯国家刑法，巧遇将会把该用户相关信息提交到国家相关机关，并配合协助相关追究该用户法律责任。\n', 2, '2019-04-30 12:22:56'),
	(3, '巧遇“注意事项”', '1．本平台禁止黄，赌，毒等一切违法行力， 违者移交警察公安处理。 \n2．本平台禁止发布拉人户告，一经发现 永久封号处理。 \n3．主播禁止在本平台私加用户的电话， 微信，QQ等联系方式，一经发现永 久封号处理。\n4．主播在和用户视频时，不露脸出镜，视频不对本人，用户一但投诉，一经发现轻则禁用视频功能，重则封号处理。\n', 3, '2019-04-30 12:24:00'),
	(4, '会员“VIP,,的好处 ', '1.“免费’与主播无限制一对一私聊。 \n2.“免费”无限制观看主播私密视频。\n3.“免费”无限制观看主播私密照片。\n', 4, '2019-04-30 12:24:31'),
	(5, '官方“高薪”招聘', '招聘主播，代理，运营（详情咨询“消息”中的官方客服）\n', 5, '2019-04-30 12:25:05'),
	(6, '分享收徒“赚钱”', '一、注册奖励 \n1.邀请真实一级男用户注册奖励 2金币=2元(人民币)； \n2.邀请真实二级男用户注册奖励 1金币=1元(人民币)； \n3.邀请真实一级女用户申请成力主播 奖励1金币=1元(人民币)；\n二、永久收益 \n1．你邀请的一级男用户充值消费获得消费的3%，二级用户充值消费获得消费的2% \n2.邀请的一级女主播获得其收益的15%, 二级女主播获得其收益的5%\n', 6, '2019-04-30 12:25:35'),
	(7, '主播“申请步骤”及“玩法”', '1.点击右下角“我的”里面有个“申请主播”填写资料，添加官方运营微信或LINE进行审核，提交不成功的，“点消息”里面的“在线客服”进行咨询。 \n2.点击右下角“我的”页面中右上角有个“修改资料”上传封面，填写相关资料保存，没上传封面的主播是不会推荐到主播页面的，然后点击右下角“我的”页面中的“系统设置”中的退出，重新登入。\n3．使用刚刚注册的方式重新登入本平台，点击右下角“我的”页面中的“收费设置”进行收费设置。\n 4.点击软件中的“首页”页面上方“男粉”中的粉丝进行互动赚钱，也可以点击页面下方的“速配”在线和粉丝进行视频速配互动赚钱。\n', 7, '2019-04-30 12:26:09'),
	(8, '速配“玩法”及“规则”', '何谓“速配”从表面意思看就是快速的匹配\n“速配”规则：\n 1．美女主播先加入“速配”，点击开始“速配”后屏幕不能退出或缩小或切换到其它的软件，否则用户是看不到你的视频的，是没有用户联接你的视频，同时“速配”也是不计算时同的。\n2．用户加入“速配”可以免费试看美女主播5秒，如喜欢，用户点接通，会直接联上美女主播进行视频，如不喜欢，可以试看5秒，后自动切换到下一个美女主播，也可以手动切换到下一个美女主播。 \n', 8, '2019-04-30 12:27:06'),
	(9, '主播“动态视频”设置方法及展示', '一主播“动态视频”设置方法 \n主播用户点击右下角“我的”页面中有个“相册”进入，点击“我要上传”选择一个主播自己15秒左右手机自拍，没有别的的平台标志的小视频上传，收费设置为默认0，然后提交，等待后台审核，如果主播用户想更换“动态视频”则按以上方法重新上传一个新的小视频，等待审核即可。 \n二 . 主播“动态视频”展示位置\n主播用户上传的视频后台审核以后，会显示在用户点击封面，以视频的形象展示给用户，同时也会展示在主播主动给用户拨打视频等待界面，用户也是能直接看到主播动态视频。\n', 9, '2019-04-30 12:27:33');
